import React from 'react';
import LOGO from "../images/Ferrari-Scuderia-Symbol.png"


const Header = () => {
  return (
    <div className='header'>
        <img src={LOGO} alt="logo" className='logo'/>

        
    </div>
  );
}

export default Header;
